import React, { Component } from 'react';
import Hearder from '../../components/Header'

import { Container } from '../home/styled'
import BarraLateral from '../../components/BarraLateral'
import { Meio } from '../../components/CaixaCentral/styled';
import * as firebase from 'firebase'

export default class Usuario extends Component {
  constructor() {
    super();
    this.state = {
      usuario: []
    }
  }


  componentDidMount() {

    const dadosPedidos = firebase.database().ref('Usuario')

    console.log('dadosPedidos', dadosPedidos)

    dadosPedidos.on('value', snap => {

      var usuario = snap.val()

      this.setState({

        usuario
      })
      console.log(usuario)
    })
  }


  renderObj = () => {
    const { pedido } = this.state
    console.log(pedido)
    return (
      Object.keys(pedido).map((obj, i) => {
        return (
          <h1></h1>
        )
      }))
  }

  render() {
    const { usuario } = this.state
    return (

      <Container>
        <Container>
          <Hearder />
          <BarraLateral />
          <Meio>
            <h1 class="dadosUsuario" >{usuario.nome}</h1>
            <h3 class="dadosUsuario" >{usuario.Email}</h3>
          </Meio>
        </Container>
      </Container>

    )
  }
}
